def transform(sequence):
    count = {}
    for i, num in enumerate(sequence):
        count[num] = count.get(num, []) + [i]
    digits = sorted(count.keys(), key=lambda x: int(x))
    transformed = ['0'] * len(sequence)
    for i, digit in enumerate(digits):
        indices = count[digit]
        new_digit = str(i)
        for j in indices:
            transformed[j] = new_digit
    return ''.join(transformed)
